import React, { Component } from "react";

class Work extends Component {
  state = {};
  render() {
    return (
      <div className="row">
        <div className="col-sm-12 col-lg-6">
          <div className="row">
            <h1>WORK</h1>
          </div>
          <div className="row">
            <h4>Dig into my Universe</h4>
          </div>
          <div className="row">
            <p>This is a direction of scope ...</p>
          </div>
          <div className="row">
            <a
              role="button"
              class="btn btn-primary"
              href="http://web.facebook.com/bilal.luqman.5"
            >
              EXPLORE
            </a>
          </div>
        </div>
      </div>
    );
  }
}

export default Work;
